import React from "react";
import Home from "./Home";
import { Route, Routes } from "react-router-dom";
import Contact from "./Contact";
import About from "./About";
import Service from "./Service";

const App = () => {
  return (
    <>
    <Routes>
        <Route path="/" element />
    </Routes>
      <Home />
    </>
  );
};

export default App;
